import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import CarList from "./component/CarList";
import CarDetail from "./component/CarDetail";
import Login from "./component/Login";
import SignUp from "./component/Signup";
import CarForm from "./component/CarForm"; // Import the CarForm component

const App = () => {
  return (
    <Router>
      <div className="container mt-4">
        <h1>Car Management Application</h1>
        <Switch>
          <Route path="/login" component={Login} />
          <Route path="/signup" component={SignUp} />
          <Route path="/product-list" component={CarList} />
          <Route path="/product/:id/edit" render={(props) => <CarForm isEdit={true} {...props} />} />
          <Route path="/product/:id" component={CarDetail} />
          <Route path="/" component={Login} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
